import React from 'react';
import {connect} from "react-redux";
function Cart(cart) {
    return (
        <>
        {
            cart.map((cartObj)=>{
                return (
                    <div key={cartObj.id}>

                        <div>{cartObj.image}</div>
                        <div>{cartObj.image}</div>
                        <div>{cartObj.image}</div>
                    </div>
                )
            })
        }
        </>
    )
}
const mapStateToProps = store  => {
    return store.cart;
}
export default Cart
